import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for search results to appear
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results.png'));

    // Click on the first product
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_first_product_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_first_product_clicked.png'));

    // Wait for product detail to load
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_product_detail.png'));

    return {
      success: true,
      action: "Completed rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
